import { LoadingButton } from "@mui/lab";
import {
  Box,
  Button,
  Card,
  Checkbox,
  FormControlLabel,
  FormHelperText,
  MenuItem,
  TextField,
} from "@mui/material";
import FlexBox from "../../components/flexBox/FlexBox";
import { H1, Small } from "components/Typography";
import { useFormik } from "formik";
import useAuth from "hooks/useAuth";
import { FC, useState } from "react";
import toast from "react-hot-toast";
import { Link, useNavigate } from "react-router-dom";
import * as Yup from "yup";

const Register = () => {
  const { register } = useAuth();
  const navigate = useNavigate();
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);

  const initialValues = {
    name: "",
    email: "",
    password: "",
    repeatPassword: "",
    userType: "",
    terms: true,
    submit: null,
  };

  const validationSchema = Yup.object().shape({
    name: Yup.string().required("Name is required"),
    email: Yup.string()
      .email("Must be a valid email")
      .max(255)
      .required("Email is required"),
    password: Yup.string()
      .min(6, "Password should be of minimum 6 characters length")
      .required("Password is required"),
    repeatPassword: Yup.string()
      .oneOf([Yup.ref("password"), null], "Passwords must match")
      .required("Repeat password is required"),
    userType: Yup.string().required("User type is required"),
    terms: Yup.boolean().oneOf([true], "You must accept the terms and conditions"),
  });

  const { errors, values, touched, handleBlur, handleChange, handleSubmit } =
    useFormik({
      initialValues,
      validationSchema,
      onSubmit: async (values) => {
        setLoading(true);
        try {
          await register(values.email, values.password, values.name);
          setLoading(false);
          toast.success("You registered successfully");
          navigate("/login");
        } catch (error) {
          setError(error?.message);
          setLoading(false);
        }
      },
    });

  return (
    <FlexBox
      sx={{
        alignItems: "center",
        flexDirection: "column",
        justifyContent: "center",
        height: { sm: "100%" },
      }}
    >
      <Card sx={{ padding: 4, maxWidth: 600, boxShadow: 1 }}>
        <FlexBox
          alignItems="center"
          flexDirection="column"
          justifyContent="center"
          mb={5}
        >
          <Box width={38} mb={1}>
            <img src="/static/logo/logo.svg" width="100%" alt="Uko Logo" />
          </Box>
          <H1 fontSize={24} fontWeight={700}>
            Get started with SkinEdu
          </H1>
        </FlexBox>

        <form noValidate onSubmit={handleSubmit} style={{ width: "100%" }}>
          <TextField
            fullWidth
            name="name"
            type="text"
            label="Name"
            variant="filled"
            margin="normal"
            onBlur={handleBlur}
            onChange={handleChange}
            value={values.name || ""}
            error={Boolean(touched.name && errors.name)}
            helperText={touched.name && errors.name}
            InputProps={{ style: { color: "white" } }}
            InputLabelProps={{ style: { color: "white" } }}
            sx={{ backgroundColor: "#FF4E7E", borderRadius: 10 }}
          />

          {/* Repeat for other text fields (email, password, repeatPassword) */}

          <FormControlLabel
            control={
              <Checkbox
                disableRipple
                checked={values.terms}
                onChange={handleChange}
                name="terms"
                sx={{ color: "#FF4E7E" }}
              />
            }
            label="I agree to terms & conditions"
            sx={{
              marginTop: "0.5rem",
              "& .MuiTypography-root": { fontWeight: 600, color: "white" },
            }}
          />

          {error && (
            <FormHelperText
              error
              sx={{
                mt: 2,
                fontSize: 13,
                fontWeight: 500,
                textAlign: "center",
              }}
            >
              {error}
            </FormHelperText>
          )}

          <Box sx={{ mt: 4 }}>
            {loading ? (
              <LoadingButton loading fullWidth variant="contained">
                Sign Up
              </LoadingButton>
            ) : (
              <Button fullWidth type="submit" variant="contained" sx={{ backgroundColor: "#FF4E7E", borderRadius: 20 }}>
                Sign Up
              </Button>
            )}
          </Box>
        </form>

        <Small margin="auto" mt={3} color="text.disabled">
          Do you already have an account?{" "}
          <Link to="/login">
            <Small color="primary.main">Log in</Small>
          </Link>
        </Small>
      </Card>
    </FlexBox>
  );
};

export default Register;
